import React from 'react'
import {Outlet} from 'react-router-dom'
import './Menu.css'

import MenuNavbar from './menu/MenuNavbar.js'

function Menu() {
  return (
      <><MenuNavbar /><Outlet /></>
  )
}

export default Menu
